//       <div>
//         <Switch>
//                 <Route  path="/signup" component={SignUp} />
//                 <Route  path="/" component={Login} />
//             </Switch>
//       </div>
//     )
//   }
// }
export const Layout = () =>

  (
    <div>
      <Switch>
        <Route exact path="/signup" component={SignUp} />
        <Route path="/login" component={Login} />
      </Switch>
    </div>
  )


function SignUp() {
  return (
    <div>
      123
    </div>
  )
}
